package http

import (
	"math/rand"
	"net/http"
	"time"
)

const DEFAULT_USER_AGENT = "Mozilla/5.0 (compatible; WP Enum v0.1)"

type UserAgent struct {
	isRandom bool
}

func NewRandomUA() UserAgent {
	return UserAgent{true}
}

func (ua UserAgent) Agent() string {
	agent := DEFAULT_USER_AGENT
	if ua.isRandom {
		agent = getRandomAgent()
	}
	return agent
}

func (ua UserAgent) SetHeader(req *http.Request) *http.Request {
	req.Header.Set("user-agent", ua.Agent())
	return req
}

func getRandomAgent() string {
	rand.Seed(time.Now().UnixNano())
	agents := getAgents()
	idx := rand.Intn(len(agents))
	return agents[idx]
}

